import React from "react";
import "./style.css";
import { Icon } from '@iconify/react';

export default function BtnS(props) {
    return (
        <div className="btn-s" >
            <p className="btn-txt">{props.text}</p>
            <Icon icon="akar-icons:arrow-right" color="white" width="30" height="30" />
        </div>
    )
}
